		Flourish.initStoryPlayer(undefined, new Flourish.Story(1064518, 1042, {"name":"PECs - ML","showcase_url":"https://public.flourish.studio/story/1064518/","embed_url":"https://flo.uri.sh/story/1064518/embed","edited_since_published":false,"nav_style":"default","nav_css":null,"is_password_protected":false,"audio_url":null,"is_timed":false,"loops_at_end":false,"default_slide_duration":5,"video_id":null}, [new Flourish.Slide(undefined, 3473155, {"index":0,"visualisation_id":8102847,"state":{"histogram":true,"controls_map":{"_index_":0},"column_filter":"2293449-187","controls_size":{"_index_":0},"controls_color":{"_index_":0},"controls_group":{"_index_":0},"controls_filter":{"_index_":0},"controls_compare":{"_index_":0},"controls_showing":false},"duration":null,"caption_text":"\u003cp>Aqui estão todos os deputados\u003c/p>"}), new Flourish.Slide(undefined, 3473158, {"index":1,"visualisation_id":8102847,"state":{"histogram":true,"group_index":1,"controls_map":{"_index_":0},"column_filter":"2293449-187 - PEC 23/2021 - Precatórios","controls_size":{"_index_":0},"controls_color":{"_index_":0},"controls_group":{"_index_":2},"controls_filter":{"_index_":0},"controls_compare":{"_index_":0},"controls_showing":false},"duration":null,"caption_text":"\u003cp>Dividindo o conjunto de deputados em clusters, com base no seus votos em proposições de PECs, temos três clusters, que nessas propostasvotaram de maneira parecida\u003c/p>"}), new Flourish.Slide(undefined, 3474913, {"index":2,"visualisation_id":8111862,"state":{"title":"\u003cp>\u003cstrong style=\"background-color: transparent; color: rgb(29, 28, 29);\">Quais são os partidos com mais representantes em cada cluster? Por quê? Como divergem os deputados?\u003c/strong>\u003c/p>","photo_url":"https://imagens.ebc.com.br/jdKlb--iDsVNk1w00v_Nh3GRqzo=/1170x700/smart/https://agenciabrasil.ebc.com.br/sites/default/files/thumbnails/image/img20200318175216276.jpg?itok=bkUnqRX0","show_text":false,"text_align":"center","height_mode":"aspect_ratio","slide_layout":"text-overlay","show_subtitle":false},"duration":null,"caption_text":null}), new Flourish.Slide(undefined, 3476169, {"index":3,"visualisation_id":8102847,"state":{"histogram":true,"color_index":1,"group_index":0,"controls_map":{"_index_":0},"column_filter":"2293449-187 - PEC 23/2021 - Precatórios","controls_size":{"_index_":0},"controls_color":{"_index_":2},"controls_group":{"_index_":1},"controls_filter":{"_index_":0},"controls_compare":{"_index_":0},"controls_showing":false},"duration":null,"caption_text":"\u003cp>\u003cspan style=\"color: rgb(0, 0, 0);\">No cluster 0, os dois partidos com mais representantes são o PT com 32 e o PSL com 22. Ambos também são os partidos com o maior número de representantes na Câmara.\u003c/span>\u003c/p>"}), new Flourish.Slide(undefined, 3476172, {"index":4,"visualisation_id":8102847,"state":{"histogram":true,"color_index":3,"group_index":0,"controls_map":{"_index_":0},"column_filter":"2293449-187 - PEC 23/2021 - Precatórios","controls_size":{"_index_":0},"controls_color":{"_index_":4},"controls_group":{"_index_":1},"controls_filter":{"_index_":0},"controls_compare":{"_index_":1},"controls_showing":false},"duration":null,"caption_text":"\u003cp>\u003cspan style=\"color: rgb(0, 0, 0);\">A divergência mais significativa de votação entre os dois partidos aconteceu na chamada \u003c/span>\u003cstrong style=\"color: rgb(0, 0, 0);\">PEC dos Precatórios\u003c/strong>\u003cspan style=\"color: rgb(0, 0, 0);\">. Enquanto todos os deputados do PT votaram contra a PEC, 31 do PSL foram a favor.\u003c/span>\u003c/p>"}), new Flourish.Slide(undefined, 3476376, {"index":5,"visualisation_id":8102847,"state":{"legend":{"text_weight":"normal","swatch_width":0.75},"histogram":true,"color_index":3,"group_index":0,"controls_map":{"_index_":0},"column_filter":"2275537-117","controls_size":{"_index_":0},"controls_color":{"_index_":4},"controls_group":{"_index_":1},"controls_filter":{"_index_":7},"controls_compare":{"_index_":0},"controls_showing":false},"duration":null,"caption_text":"\u003cp>Na PEC que votou a \u003cstrong>composição do Conselho Nacional do Ministério Público\u003c/strong>, dividida em dois turnos, a diferença foi menor, com mais deputados do PSL rejeitando a proposta, mas ainda assim foram 9 votos a favor da PEC no primeiro turno. Os deputados do PT deram apenas um voto favorável no primeiro turno.\u003c/p>"}), new Flourish.Slide(undefined, 3476400, {"index":6,"visualisation_id":8102847,"state":{"legend":{"text_weight":"normal","swatch_width":0.75},"histogram":true,"color_index":3,"group_index":0,"controls_map":{"_index_":0},"column_filter":"2275537-102","controls_size":{"_index_":0},"controls_color":{"_index_":4},"controls_group":{"_index_":1},"controls_filter":{"_index_":4},"controls_compare":{"_index_":0},"controls_showing":false},"duration":null,"caption_text":"\u003cp>No segundo turno, 13 deputados do PSL foram favoráveis, enquanto todos do PT votaram contra.\u003c/p>"}), new Flourish.Slide(undefined, 3476405, {"index":7,"visualisation_id":8102847,"state":{"legend":{"text_weight":"normal","swatch_width":0.75},"histogram":true,"color_index":3,"group_index":0,"controls_map":{"_index_":0},"column_filter":"2165194-130","controls_size":{"_index_":0},"controls_color":{"_index_":4},"controls_group":{"_index_":1},"controls_filter":{"_index_":5},"controls_compare":{"_index_":0},"controls_showing":false},"duration":null,"caption_text":"\u003cp>Já na PEC relacionada à \u003cstrong>distribuição de recursos ao Fundo de Participação dos Municípios,\u003c/strong> ambos partidos votaram de forma parecida. 35 deputados do PSL e 32 do PT votaram favoráveis à PEC formando maioria dentro dos partidos.\u003c/p>"}), new Flourish.Slide(undefined, 3476858, {"index":8,"visualisation_id":8120169,"state":{"text":"\u003cp>(Arte: MÍDIA NINJA)\u003c/p>","title":"\u003cp>\u003cstrong>NOVO e PSOL no mesmo cluster??\u003c/strong>\u003c/p>","subtitle":"\u003cp>Apesar de adotarem discursos políticos muito diferentes, os deputados federais do Partido Novo e do PSOL votaram alinhados em praticamente todas as PECs que analisamos. Em sete das nove votações de Propostas de Emenda à Constituição, houve total coincidência nos votos dos dois partidos. Como nossa base inclui a votação em dois turnos, no resultado da segunda votação só houve discordância entre os dois partidos em uma PEC.\u003c/p>","photo_url":"https://midianinja.org/files/2017/07/psolpartidonovo.png","slide_layout":"text-overlay"},"duration":null,"caption_text":null}), new Flourish.Slide(undefined, 3476867, {"index":9,"visualisation_id":8120202,"state":{"histogram":true,"color_index":0,"group_index":0,"controls_map":{"_index_":0},"column_filter":"2275537-102","compare_index":3,"controls_size":{"_index_":0},"controls_color":{"_index_":1},"controls_group":{"_index_":1},"controls_filter":{"_index_":0},"controls_compare":{"_index_":4},"controls_showing":false},"duration":null,"caption_text":"\u003cp>Exemplo de alinhamento: PEC 23/2021,\u003c/p>"}), new Flourish.Slide(undefined, 3476894, {"index":10,"visualisation_id":8120202,"state":{"histogram":true,"color_index":0,"group_index":0,"controls_map":{"_index_":0},"column_filter":"2165194-130","compare_index":3,"controls_size":{"_index_":0},"controls_color":{"_index_":1},"controls_group":{"_index_":1},"controls_filter":{"_index_":1},"controls_compare":{"_index_":4},"controls_showing":false},"duration":null,"caption_text":"\u003cp>Mas nem sempre os partidos concordaram: na PEC 391/2017, que aumenta em um ponto porcentual os repasses de alguns tributos da União para as cidades, por meio do Fundo de Participação dos Municípios. Três deputados do Novo votaram contra o projeto ou entraram com obstrução. Mas os outros integrantes do partido foram a favor, como os três do PSOL. Em uma reportagem do Congresso em Foco, Ganime disse que era contra a PEC porque o “Orçamento da União está quebrado”.\u003c/p>"}), new Flourish.Slide(undefined, 3476833, {"index":11,"visualisation_id":8120071,"state":{"text":"\u003cp>\u003cbr>\u003c/p>\u003cp>Divergiram dos outros deputados, mas seguiram a orientação do partido:&nbsp;Célio Silveira (PSDB) - 2 votações; Carla Dickson (PROS) - 1 votação; Gonzaga Patriota (PSB) - 1 votação; Marcelo Freixo (PSB) - 1 votação; Rossoni (PSDB) - 1 votação; Vitor Lippi (PSDB) - 1 votação.\u003c/p>\u003ch2>\u003cbr>\u003c/h2>\u003cp>\u003cbr>\u003c/p>","title":"\u003cp>\u003cstrong>Líder da divergência\u003c/strong>\u003c/p>","subtitle":"\u003cp>\u003cspan style=\"color: rgb(36, 41, 47);\">Joice Hasselmann (PSL) é a que mais divergiu, votando diferente em 5 votações e indo contra a orientação do partido.\u003c/span>\u003c/p>","photo_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Joice_Hasselmann_em_mar%C3%A7o_de_2019.jpg","slide_layout":"text-overlay","photo_position":"top-center","photo_position_v":"top"},"duration":null,"caption_text":null}), new Flourish.Slide(undefined, 3476836, {"index":12,"visualisation_id":8120014,"state":{"histogram":true,"group_index":0,"controls_map":{"_index_":0},"column_filter":"531331-284","controls_size":{"_index_":0},"controls_color":{"_index_":0},"controls_group":{"_index_":1},"controls_filter":{"_index_":0},"controls_compare":{"_index_":0},"controls_showing":false},"duration":null,"caption_text":"\u003cp>Esses são os deputados do PSL, divididos por cluster.\u003c/p>\u003cp>Joice Hasselman está no cluster dois com a minoria do partido\u003c/p>"}), new Flourish.Slide(undefined, 3476839, {"index":13,"visualisation_id":8120014,"state":{"popup":{"locked_id":"id_Joice Hasselmann-0"},"histogram":true,"group_index":0,"controls_map":{"_index_":0},"column_filter":"531331-284","controls_size":{"_index_":0},"controls_color":{"_index_":0},"controls_group":{"_index_":1},"controls_filter":{"_index_":0},"controls_compare":{"_index_":0},"controls_showing":false},"duration":null,"caption_text":"\u003cp>Esses são os deputados do PSL, divididos por cluster.\u003c/p>\u003cp>Joice Hasselman está
